// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Bar

{

constructor () public {
    owner =msg.sender;
    uniqueId[owner] = 1;

}
struct Foo{
uint256 x;
address y;
}

mapping (address => uint256) uniqueId;
mapping (uint => Foo[]) foo;
uint256 amountOfUser ;
address public owner;

function returnAmountOfUser() public returns (uint256)
{
return amountOfUser;
}

function getUniqueId() public returns (uint256){
if (uniqueId[msg.sender] > 1)
{
return uniqueId[msg.sender];
}

else {
uint256 amountUser = returnAmountOfUser();
amountUser = amountUser += 1;
uniqueId[msg.sender] = amountUser +=1 ;
return uniqueId[msg.sender];
}
}

function add(uint256 _x,address _y) public {
uint ID = getUniqueId();
foo[ID].push(Foo(_x,_y));
ID = 0;
}

function get(uint256 id, uint index) public view returns(address){
// index refer to the order of struct in array,0 for first , 1 for seond
return foo[id][index].y;
}
}
